class Login extends Component {
  state = {
    login: '',
    password: '',
  };

  clickLogin = () => {
    this.navigateToHome();
  };

  changeLogin = text => {
    this.setState({login: text});
  };

  changePassword = text => {
    this.setState({password: text});
  };

  navigateToHome = () => {
    const {navigation} = this.props;
    const {login, password} = this.state;

    if (login == 'Chrigor' && password == '123') {
      navigation.navigate('RotasHome', {user: userLogado});
    } else {
      Alert.alert('Erro de usuário e senha');
    }
  };

  render() {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.containerLogin}>
          <Image
            style={styles.logo}
            source={require('../../assets/logo.png')}
          />
          <View style={styles.containerInput}>
            <Icon name="user" color="#5458F7" size={25} style={styles.icon} />
            <TextInput
              style={styles.input}
              placeholder="Digite seu Login ..."
              placeholderTextColor="#fff"
              onChangeText={this.changeLogin}
            />
          </View>
          <View style={styles.containerInput}>
            <Icon name="chain" color="#5458F7" size={25} style={styles.icon} />
            <TextInput
              style={styles.input}
              placeholder="Digite sua Senha ..."
              secureTextEntry={true}
              placeholderTextColor="#fff"
              onChangeText={this.changePassword}
            />
          </View>
          <TouchableHighlight
            style={styles.buttonLogin}
            onPress={this.clickLogin}>
            <Text style={styles.textLogin}>Login</Text>
          </TouchableHighlight>
        </View>
      </SafeAreaView>
    );
  }
}

